import {View, Text, Image, StyleSheet, Button, TextInput, SafeAreaView} from "react-native";
import { COLORS, SIZES,FONTS} from '../styles/theme.js';
import { FieldArray, Formik} from "formik";
import globalText from '../styles/globalText';
import AnimatedLottieView from "lottie-react-native";
import LottieView from "lottie-react-native";
import { render } from "react-dom";




export default function  Completed ({ navigation }) {



   return (

        <View style={styles.whitecard}>

            <LottieView
            source={require("../assets/lottie/completed.json")}
            style={styles.completedAnimation}
            autoPlay
            loop
            />


        </View>


    );

 }

 const styles = StyleSheet.create({
    inputstyle:{
        borderWidth:0.2,
        borderColor: 'gray',
        padding:8,
        fontSize:15,
        borderRadius:6,
        marginTop :10,
        marginRight:15,
        marginLeft:15,



    },

    completedAnimation:{

        width:200,
        height:200,
        alignSelf:'center',
        marginTop:70,

    },
    whitecard:{
            flex: 1,
            backgroundColor: '#fbfbfb',
            alignContent:'center',
            padding: 20, 
            paddingTop:50,
            shadowColor: '#000',
            shadowOpacity: 0.1, },
})
